                <div className="content-wrapper">
                    <h1>Welcome to My Portfolio</h1>
                    {/* Other content */}
                </div>
            </main>
            <footer>
                {/* Footer content */}
            </footer>
        </div>
      <h2>tammyTran = ['developer', 'designer'],</h2>
      <h3>// full-stack developer who loves to learn and make cool things! Add more later :)</h3>
    </>
  );
};

export default Home;
